def insert_administrations(apps, schema_editor):
    Administration = apps.get_model("sv", "Administration")
    administrations = [Administration(nom=nom) for nom in ADMINISTRATIONS]
    Administration.objects.bulk_create(administrations)


def delete_administrations(apps, schema_editor):
    Administration = apps.get_model("sv", "Administration")
    Administration.objects.filter(nom__in=ADMINISTRATIONS).delete()


def insert_unites(apps, schema_editor):
    Administration = apps.get_model("sv", "Administration")
    administration_centrale = Administration.objects.get(nom="Administration centrale")
    service_regional = Administration.objects.get(nom="Service régional")

    Unite = apps.get_model("sv", "Unite")

    unites_administration_centrale = [
        Unite(nom=nom, type=administration_centrale) for nom in UNITES_ADMINISTRATION_CENTRALE_NOMS
    ]
    unites_service_regional = [Unite(nom=nom, type=service_regional) for nom in UNITES_SERVICE_REGIONAL_NOMS]

    Unite.objects.bulk_create(unites_administration_centrale + unites_service_regional)


def delete_unites(apps, schema_editor):
    Unite = apps.get_model("sv", "Unite")
    Unite.objects.filter(nom__in=UNITES_ADMINISTRATION_CENTRALE_NOMS + UNITES_SERVICE_REGIONAL_NOMS).delete()


