def insert_departements(apps, schema_editor):
    Region = apps.get_model("sv", "Region")
    Departement = apps.get_model("sv", "Departement")

    departements_to_create = []
    for numero, nom, region_nom in DEPARTEMENTS:
        region = Region.objects.get(nom=region_nom)
        departement = Departement(numero=numero, nom=nom, region=region)
        departements_to_create.append(departement)

    Departement.objects.bulk_create(departements_to_create)


def delete_departements(apps, schema_editor):
    Departement = apps.get_model("sv", "Departement")
    Departement.objects.filter(numero__in=[numero for numero, _, _ in DEPARTEMENTS]).delete()


